script: |
  super -f text -I q886.spq | sort > q886.out

inputs:
  - name: q886.spq
    data: |
      SELECT ( - col0 ) FROM tab2 (FORMAT parquet) AS cor0 WHERE - col0 * - - 49 NOT BETWEEN - ( 72 ) AND ( - col0 * - col2 * + - 31 + + + 83 * - + 18 );
  - name: tab2

outputs:
  - name: q886.out
    data: |
      -46
      -64
      -75
